B.Ov=new A.aY(2,{title:"Cerebrum",konten:"Terdiri dari sepasang hemispherium cereberi dan diencephalon. Dimana hemispherium tersusun atas substansia gresea, substansia alba, corpus callosum, commisura anterior, formation Hippocampus, dan amygydala. Formation Hippocampus dan amygdala merupakan struktur dari system limbik.\nCerebrum terdiri atas 2 hemisfer. setiap hemisper tersusun atas:\n- cortex cerebri \u2192 lapisan badan sel dengan tebal 0,5 (Gyrus, sulcus)\nsustansia alba \u2192 axon bermielin\nnukleus basalis \u2192 fungsi motoris\n\nCerebrum dibagi menjadi 6 lobus, yaitu: \n\nLobus frontalis, terletak pada bagian rostaral dan dibatasi oleh sulcus centralis\n\u2192 higher intelllect, personality, mood, social conduct, dan bahasa \n\nLobus parietalis, terletak antara sulcus centralis dan sulcus parietooccipitalis\n\u2192 bahasa dan fungsi visuospatia\n\nLobus oksipitalis, terletak pada bagian posterior sulcus parietooccipitalis\n\u2192 area olfactory(17,18), area olfactory assosiasi(19)\n\nLobus Teporalis, terletak pada bagian lateral dari gyrus parahippocampus\n\u2192 area auditoris primer (41,42), area auditoris assosiasi (22)\n\nLobus Limbik, dibentuk oleh lobus frontal parietal, dan temporal. Berbentuk cincin dan terdiri dari area subcallosial, gyrus cingulate, gyrus para hippocampus, hippocampus, gyrus dentatus, dan uncus.\n\u2192 fungsi : emosi, memori, fungsi-fungsi primitive perilaku (keputusan tentang nilai-nilai bawah sadar), perhatian, spontanitas\n\nLombus Insularis\n\n"},B.bA,t.l)
B.Oz=new A.aY(2,{title:"Lobus Limbikus",konten:"Komponen penting sistem Limbik:\n\n1)Amydala (berbentuk seperti almond atau kenari)\na) membantu menyimpan dan klasifikasi memori emosional\nb) berperan penting dalam produksi emosi (terutama takut)\nc) Memicu respon terhadap emosi kuat, seperti tangan berkeringat, freezing, peningkatan denyut jantung, pelepasan hormon stress.\n\n2) Hippocampus\na)1. berperan dalam memori dibanding belajar / learning\nb) berperan penting dalam formasi memori, klasidikasi memori dan long-term memory\nc) terlibat dalam interpretasi isyarat saraf yang masuk dan relasi spasial\n\nThalamus / diencephalon\na) Tersusun atas hypothalamus, subthalamus, epithalamus, dan dorsal halamus\nb) relay stasion di otak: isyarat-isyarat sensoris, auditoris, visual somatosensoris, dan viserosensoris\nc) Berperan dalam pengendalian motoris\n\n4)Hypothalamus\na) Monitoring dan mengendalikan irama sirkadian (sirkulasi tidur-terjaga)\nb)berperan dalam homeostatis (menjamin fungsi-fungsi tubuh berlangsung secara halus)\nc) selera makan, haus, urgensi tubuh lain\nd) emosi, fungsi-fungsi otonomik dan motorik\n\nVaskularisasi\na) Arteri cerebri anterior \u2192 suplai darah untuk bagian anteromedial cerebri\nb)Arteri cerebri medial \u2192 suplai darah untuk bagian alteral cerebri\nc) Arteri cerebri posterior \u2192 suplai darah untuk bagian medial dan lateral cerebri\nd) vena cerebralis \u2192 sinus venosus dural\n\n"},B.bA,t.l)
B.Os=new A.aY(2,{title:"Cerebellum",konten:"Bagian dari sistem motoris yang berfungsi untuk mengkoordinasikan aktivitas otot, menghasilkan gerakan halus, dan mengontrol keseimbangan dan tonus otot. Tersusun atas 2 herisfer dan dihubungkan oleh vermis. tersusun atas substansia gresea dan substansia alba.\n\n Pembagian lobus secara anatomis:\na)lobus anterior\nb)lobus posterior\nc)Lobus floculonadular\n\npembagian lobus secara Divisi Fungsional:\na)Cerebrocerebellum, berfungsi untuk mengkoordinasi aktivitas otot dan menerima informasi dari cortex cerebri dan nucleus pontin\nb) Spinocerebellum, berfungsi untuk menerima informasi proprioceptive dan mengkoordinasi gerakan\nc) vertibulocerebellum, berfungsi untuk mengontrol keseimbangan reflex ocular dan menerima input dari sistem vesibular dan mengirimkannya\n\nVaskularisasi\n\na) Arteri cerebellaris superior\nb) Arteri cerebellaris anterior inferior\nc) Arteri cerebellaris posterior inferior\nd) Vena cereberallis superior dan inferior\n\n"},B.bA,t.l)
B.Ox=new A.aY(2,{title:"Ganglia Basalia",konten:"Ganglia basalia tersusun atas nucleus caudatus, nuleus linticularis, nucleus subthalamic, dan substansia nigra.\nNucleus caudatus dan nucleus lenticularis bergabung membentuk corpus striatum. Merupakan nucleus profunda dari hemispherium cerebri\nNucleus lenticularis dibagi menjadi putamen dan globus pallidum (pallidum, paleostriatum)\nPutamen dan nucleus caudatus disebut dengan striatum (neostriatum)\nNucleus subthalamic terletak pada bagian ventral thalamus\nSubstansia nigra merupakan nucleus yang terletak didalam otak tengah\n\n"},B.bA,t.l)
B.Oq=new A.aY(2,{title:"Diencephalon",konten:"Terletak ventromedial dari cerebrum dan berlanjut ke caudal bersama dengan otak tengah Terdiri dari 4 divisi: epithalamus, thalamus (thalamus dorsal), hypothalamus, thalamus ventral (subthalamus)\nEpthalamus, plexus choroideus ventrikel ke-3, dan corpus pineal membentuk atap diencephalon\nypothalamus terletak pada bagian ventral dari thalamus yang terdiri dari corpus mammillary dan hypophysis (glandula pituitary)\nThalamus ventral terletak di sebelah lateral dari hypothalamu\n\n"},B.bA,t.l)
B.Ou=new A.aY(2,{title:"Sirkulasi",konten:"Suplai arteri berasal dari a. vertebralis dan a. carotis internal\nA. vertebralis \u2192 foramen magnum \u2192 pontomedullary junction \u2192 a. basillaris \u2192 a. cerebralis posterior.\nCabang a. basillaris dan a. vertebralis memvaskularisasi medulla, pons, cerebellum, midbrain, dan bagian caudal diencephalon\nA. cerebralis posterior mensuplai darah untuk bagian kaudal diencephalon dan bagian medial lobus oksipital termasuk area korteks visualis primer (area 17) dan lobus temporalis inferior posterior\nCabang a. vertebralis dan a. basillaris yang mensuplai bagian medial bantang otak pada bidang midsagital disebut arteri paramedian (a. spinalis anterior cabang a. basillaris)\nA. carotis interna \u2192 a. cerebri anterior \u2192 orbita dan bagian medial lobus frontal\nA. carotis interna \u2192 a. cerebri media \u2192 fissure lateral antara lobus temporal dan insula\nA. cerebri media dan a. choroidalis mensuplai darah untuk ganglia basalis.\nCircle of Willisi dibentuk oleh a. vertebralis dan a. caroti\n"},B.bA,t.l)
